fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coastal_anthropogenic_litter rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :coast ],
        :anthropogenic_litter ;
    :has_definition "Anthropogenic litter which is present in a coastal environment."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plastic_manufacturing_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :plastic ],
        :anthropogenic_environmental_process,
        :manufacturing_process ;
    :has_definition "A manufacturing process which includes plastic as one of its specified outputs."@en ;
    :has_exact_synonym "Plastikherstellung"@de,
        "plastic production"@en,
        "producción de plástico"@es,
        "produzione di plastica"@it .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:weathering_of_plastic rdfs:subClassOf :weathering ;
    :has_definition "Weathering during which plastic is worn or broken down."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_table rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :phreatic_zone ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :vadose_zone ],
        :surface_of_an_astronomical_body ;
    :has_definition "A surface layer which is 1) part of a phreatic zone in contact with a vadose zone and 2) contains interstitial water with a pressure head equal to atmospheric pressure."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_table_depth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :water_table ],
        :elevation ;
    :has_definition "An elevation which inheres in a water table by virture of its vertical distance from a land surface."@en ;
    :has_related_synonym "depth of the water table"@en,
        "depth to the water table"@en,
        "height of the water table"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:photosynthetic_photon_flux_density rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :irradiation_by_photosynthetically_active_radiation ],
        :environmental_system_process_quality,
        :rate ;
    :has_definition "A rate which is characteristic of irradiance by photosynthetically active radiation by virtue of the number of photons received by an irradiated surface over time."@en ;
    :has_exact_synonym "PPFD"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_percolation_rate rdfs:subClassOf :rate ;
    :has_definition "A rate which inheres in a soil percolation process."@en ;
    :has_exact_synonym "percolation rate in soil"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:runoff rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :waste_water ;
                            rdf:rest [ rdf:first :rainwater ;
                                    rdf:rest [ rdf:first :meltwater ;
                                            rdf:rest [ rdf:first :stormwater ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :liquid_water ;
    :has_definition "Liquid water which 1) flows over land and 2) is not absorbed or retained by the materials if flows over or through."@en ;
    :has_exact_synonym "overland flow"@en,
        "surface runoff"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:photosynthetic_photon_flux rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :photosynthetically_active_radiation ],
        :flux ;
    :has_definition "A flux which inheres in photosynthetically active radiation."@en ;
    :has_exact_synonym "PPF"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rainy_day_count rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :one_dimensional_temporal_region ],
        :amount ;
    :has_definition "The number of days during which there is precipitation"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_layer_top_depth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :soil_layer ],
        :depth ;
    :has_definition "The depth of the top part of a soil layer."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_layer_bottom_depth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :soil_layer ],
        :depth ;
    :has_definition "The depth of the bottom part of a soil layer."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_infiltration rdfs:subClassOf :water_flow_process ;
    :has_definition "A water flow process during which water occupies the pores or interstices of a solid or semi-solid material."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_infiltration_into_soil rdfs:subClassOf :water_infiltration ;
    :has_definition "A water infiltration process during which water fills the pore space and interstices of soil."@en ;
    :has_exact_synonym "soil water infiltration"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_albedo rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :soil ],
        :albedo ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :albedo ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :characteristic_of ;
                                    owl:someValuesFrom :soil ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Albedo which inheres in soil."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dry_soil_albedo rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :soil ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :dry ] ;
                                    rdf:rest :nil ] ] ] ],
        :soil_albedo ;
    :has_definition "Soil albedo which inheres in dry soil."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:moist_soil_albedo rdfs:subClassOf :soil_albedo ;
    :has_definition "Soil albedo which inheres in moist soil."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exchangeable_ion rdfs:subClassOf :ion ;
    :curator_note "Add an equivalence axiom to autopopulate this once we have ion exchange in as a process." ;
    :has_definition "An ion which is 1) adsorbed onto the surfaces of materials with an opposing charge, 2) are readily displaced by other ions, 3) may be displaced and absorbed by organisms."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exchangeable_potassium rdfs:subClassOf :exchangeable_ion ;
    :curator_note "This class will be moved under K+ once it has been imported from CHEBI"@en ;
    :has_definition "A potassium ion which is capable of ion exchange."@en ;
    :has_exact_synonym "exchangeable K+"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:residual_water_in_soil rdfs:subClassOf :liquid_water ;
    :has_definition "Liquid water which is present in soils as discontinuous volumnes of water in contact with solid and gaseous components of the soil."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exchangeable_calcium rdfs:subClassOf :exchangeable_ion ;
    :curator_note "This class will be moved under Ca2+ once it has been imported from CHEBI"@en ;
    :has_definition "A calcium ion which is capable of ion exchange."@en ;
    :has_exact_synonym "exchangeable Ca2+" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cation_exchange_capacity rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :environmental_material ],
        :physical_quality ;
    :has_definition "A physical quality which inheres in an environmental material by virtue of the material's ability to adsorb exchangeable cations."@en ;
    :has_exact_synonym "CEC"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_drainage rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :soil ],
        :drainage_process,
        :water_flow_process ;
    :has_definition "A drainage process during which liquid water is transported away from soil."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basic_cation_exchange_capacity rdfs:subClassOf :cation_exchange_capacity ;
    :has_definition "A cation exchange capacity which inheres in an environmental material by virtue of the material's ability to adsorb basic exchangeable cations."@en ;
    :has_exact_synonym "BS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:net_shortwave_radiation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :realized_in ;
            owl:someValuesFrom :stellar_radiation ],
        [ a owl:Restriction ;
            owl:onProperty :characteristic_of_part_of ;
            owl:someValuesFrom :astronomical_body ],
        :energy ;
    :has_definition "Energy which has been absorbed by an astronomical body or its parts following that body's irradiation by shortwave radiation from a star."@en ;
    :has_exact_synonym "absorbed shortwave radiation"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :soil ],
        :layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :soil ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer that is composed primarily of soil."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_profile_characterization rdfs:subClassOf :planned_process ;
    :has_definition "A planned process during which a soil profile is examined and the soil horizons that compose it are described."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:treated_wastewater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :wastewater_treatment_process ],
        :liquid_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :output_of ;
                                    owl:someValuesFrom :wastewater_treatment_process ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Waste water which was converted into an effluent that can be either returned to the water cycle with minimal environmental issues or reused."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desalinated_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :desalination_process ],
        :liquid_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :output_of ;
                                    owl:someValuesFrom :desalination_process ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Saline water from which minerals have been removed to produce fresh water suitable for human consumption or irrigation."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_texture rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :soil ],
        :texture ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :texture ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :characteristic_of ;
                                    owl:someValuesFrom :soil ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Texture which inheres in soil."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:loamy_sand rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :loam ],
        :sand ;
    :has_definition "Soil which is primarily composed of sand with silt and clay in progressively smaller proportions."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fine_sand rdfs:subClassOf :sand ;
    :has_definition "Sand which is composed primarily of fine particles."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sandy_loam rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :sand ],
        :enriched_soil,
        :loam ;
    :has_definition "Loam which has a high proportion of sand in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silty_loam rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :silt ],
        :enriched_soil,
        :loam ;
    :has_definition "Loam which has a high proportion of silt in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sandy_clay_loam rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :sand ],
        :clay_loam ;
    :has_definition "Clay loam which has a high proportion of sand in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clay_loam rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :clay ],
        :enriched_soil,
        :loam ;
    :has_definition "Loam which has a high proportion of clay in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silty_clay_loam rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :silt ],
        :clay_loam ;
    :has_definition "Clay loam which has a high proportion of silt in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sandy_clay rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :sand ],
        :clay ;
    :has_definition "Clay which has a high proportion of sand in its composition."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silty_clay rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :silt ],
        :clay ;
    :has_definition "Clay which has a high proportion of silt in its composition."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wastewater_treatment_process rdfs:subClassOf :recycling_process ;
    :has_definition "A recycling process during which wastewater is treated"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desalination_process rdfs:subClassOf :recycling_process ;
    :has_definition "A recycling process during which the dissolved mineral salts in water are removed"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:field_capacity rdfs:subClassOf :concentration_of_liquid_water_in_soil ;
    :has_definition "A concentration of liquid water in soil arrived at after water which is not retained by the soil has drained away."@en ;
    :has_exact_synonym "drained upper limit"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:permanent_wilting_point rdfs:subClassOf :concentration_of_liquid_water_in_soil ;
    :has_definition "A concentration of liquid water in soil at or below which a plant will wilt and no longer recover its turgidity when placed in a water saturated atmosphere."@en ;
    :has_exact_synonym "PWP"@en,
        "wilting point"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_holding_capacity_of_soil rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom :soil ],
        :water_holding_capacity ;
    :has_definition "Water-holding capacity which inheres in some soil."@en ;
    :has_exact_synonym "soil water-holding capacity"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:axilla_skin_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :axilla_skin ],
        :skin_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anatomical_entity_environment ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :axilla_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environment that is determined by an axilla skin."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mouth_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :mouth ],
        :anatomical_entity_environment,
        :ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anatomical_entity_environment ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :mouth ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environment that is determined by a mouth."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solubility_of_carbon_atom_in_environmental_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_atom ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :environmental_material ] ;
                                    rdf:rest :nil ] ] ] ],
        :solubility ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :solubility ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :characteristic_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_atom ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :part_of ;
                                                                    owl:someValuesFrom :environmental_material ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The solubility of a carbon atom when measured in environmental material." ;
    :has_exact_synonym "environmental material carbon atom solubility" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solubility_of_carbon_atom_in_soil rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_atom ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :soil ] ;
                                    rdf:rest :nil ] ] ] ],
        :solubility_of_carbon_atom_in_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :solubility ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :characteristic_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_atom ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :part_of ;
                                                                    owl:someValuesFrom :soil ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The solubility of a carbon atom when measured in soil." ;
    :has_exact_synonym "soil carbon atom solubility" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solubility_of_carbon_atom_in_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :characteristic_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_atom ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
