            owl:onProperty :located_in ;
            owl:someValuesFrom :freshwater_biome ],
        :algal_bloom ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :algal_bloom ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :freshwater_biome ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An algal bloom that is located in freshwater. Freshwater algal blooms are the result of an excess of nutrients, particularly some phosphates."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nest_of_termite rdfs:subClassOf :animal_habitation ;
    :has_definition "An animal habitation constructed by termites. Termite workers build and maintain nests which house the colony. These are elaborate structures made using a combination of soil, mud, chewed wood/cellulose, saliva, and faeces. A nest has many functions such as providing a protected living space and water conservation (through controlled condensation)."^^xsd:string ;
    :has_exact_synonym "termite nest"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biochar rdfs:subClassOf :charcoal ;
    :has_definition "charcoal that is used as a soil amendment." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lignite rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :peat_soil ],
        :coal ;
    :has_definition "A soft, brown, combustible, sedimentary rock formed from naturally compressed peat." ;
    :has_exact_synonym "brown coal" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sub_bitumous_coal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :lignite ],
