            owl:onProperty :derives_from ;
            owl:someValuesFrom :bitumous_coal ],
        :coal ;
    :has_definition "A hard, compact variety of coal that has a submetallic luster. It has the highest carbon content, the fewest impurities, and the highest energy density of all types of coal and is the highest ranking of coal." ;
    :has_exact_synonym "hard coal" .

