@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:energy rdfs:subClassOf :disposition ;
    :has_definition "A disposition which is realized during the execution of work, the emission of heat, or the possession of mass." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

