    :has_definition "Energy possessed by an object because of its position relative to other objects, stresses within itself, its electric charge, or other factors."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kinetic_energy rdfs:subClassOf :energy ;
    :has_definition "Energy which is realised through motion."@en .

