            owl:onProperty :has_part ;
            owl:someValuesFrom :kinetic_energy ],
        :energy ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :energy ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
