                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom :kinetic_energy ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "Energy which is the sum of 1) kinetic energy and 2) potential energy."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

